import './App.css';
import Home from './components/Home';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import NormalCar from './components/NormalCar';
import { SportyCar } from './components/SportyCar';
import { LuxeCar } from './components/LuxeCar';
import Truck from './components/Truck';
import FamilyCar from './components/FamilyCar';
import { useState, useEffect } from 'react';
import { CarsContext } from './CarsContext';
import { CONSTANTS } from './Contant';
import { WorkingWithClasses } from './components/WorkingWithClasses';

function App() {

  const [data, setData] = useState({
    carChoise: {
      normalCar: {
        engine: [],
        doors: [],
        windows: [],
        tires: [],
        rims: [],
        color: []
      },
      sportyCar: {
        engine: [],
        doors: [],
        windows: [],
        tires: [],
        rims: [],
        color: [],
        tiresmoke: [],
        rollcage: [],
        spoiler: [],
        scissordoors: [],
        sportsMode: Boolean
      },
      luxeCar: {
        engine: [],
        doors: [],
        windows: [],
        tires: [],
        rims: [],
        color: [],
        hasSeparator: Boolean,
        suicidoors: []
      },
      truckCar: {
        engine: [],
        doors: [],
        windows: [],
        tires: [],
        rims: [],
        color: []
      },
      familyCar: {
        engine: [],
        doors: [],
        windows: [],
        tires: [],
        rims: [],
        color: []
      }
    },
  });
  const AbstractEngine = [
    {
      id: 1,
      EngineType: "Benzine"
    },
    {
      id: 2,
      EngineType: "Gas"
    }
  ]
  const AbstractCarColor = [
    {
      id: 1,
      color: "Wit"
    },
    {
      id: 2,
      color: "Zwart"
    },
    {
      id: 2,
      color: "Blauw"
    }
  ]
  const AbstractDoor = [
    {
      id: 1,
      color: "Wit"
    },
    {
      id: 2,
      color: "Zwart"
    },
    {
      id: 2,
      color: "Blauw"
    }
  ]
  const AbstractWindow = [
    {
      id: 1,
      color: "Transparant"
    },
    {
      id: 2,
      color: "Gedimd"
    }
  ]
  const AbstractTire = [
    {
      id: 1,
      color: "Zwart",
      BrandName: "Michelin",
    },
    {
      id: 2,
      color: "Zwart",
      BrandName: "Continental",
      TireSmoke: "Red"
    }
  ]
  const AbstractRim = [
    {
      id: 1,
      color: "Chrome",
    },
    {
      id: 2,
      color: "Staal",
    }
  ]
  const SportyCarSpoiler = [
    {
      id: 1,
      color: "Rood"
    },
    {
      id: 2,
      color: "Blauw"
    },
    {
      id: 1,
      color: "Wit"
    },
  ]
  const SportyCarTireSmoke = [
    {
      id: 1,
      color: "Rood"
    },
    {
      id: 2,
      color: "Blauw"
    },
    {
      id: 1,
      color: "Wit"
    },
  ]
  const SportyCarRollcage = [
    {
      id: 1,
      color: "Roze"
    },
    {
      id: 2,
      color: "Rood"
    },
    {
      id: 3,
      color: "Zwart"
    }
  ]
  const ScissorDoors = [
    {
      color: "Wit"
    },
    {
      color: "Blauw"
    },
    {
      color: "Zwart"
    }
  ]
  const SuicideDoors = [
    {
      color: "Wit"
    },
    {
      color: "Blauw"
    },
    {
      color: "Zwart"
    }
  ]
  useEffect(() => {
    if (localStorage) {
      const localStorageData = localStorage.getItem(CONSTANTS.LOCAL_STORAGE_KEY);
      if (localStorageData) {
        setData(JSON.parse(localStorageData));
      }
    }
  }, []);
  return (
    <div className="App">
      <BrowserRouter>
        <CarsContext.Provider value={{ data, setData }}></CarsContext.Provider>
        <Routes>
          <Route path='/' element={<WorkingWithClasses />} />
          <Route
            path='/normale-auto'
            element=
            {
              <NormalCar
                engine={AbstractEngine}
                doors={AbstractDoor}
                windows={AbstractWindow}
                tires={AbstractTire}
                rims={AbstractRim}
                color={AbstractCarColor}
              />
            } />
          <Route
            path='/sporty-auto'
            element=
            {
              <SportyCar
                engine={AbstractEngine}
                doors={AbstractDoor}
                windows={AbstractWindow}
                tires={AbstractTire}
                rims={AbstractRim}
                color={AbstractCarColor}
                tiresmoke={SportyCarTireSmoke}
                rollcage={SportyCarRollcage}
                spoiler={SportyCarSpoiler}
                scissordoors={ScissorDoors}
                hasSportsmode
              />
            } />
          <Route
            path='/chauffeur-auto'
            element=
            {
              <LuxeCar
                engine={AbstractEngine}
                doors={AbstractDoor}
                windows={AbstractWindow}
                tires={AbstractTire}
                rims={AbstractRim}
                color={AbstractCarColor}
                hasSeparator={false}
                suicidoors={false}
              />
            } />
          <Route
            path='/truck'
            element=
            {
              <Truck
                engine={AbstractEngine}
                doors={AbstractDoor}
                windows={AbstractWindow}
                tires={AbstractTire}
                rims={AbstractRim}
                color={AbstractCarColor}
              />
            } />
          <Route
            path='/familie-auto'
            element=
            {
              <FamilyCar
                engine={AbstractEngine}
                doors={AbstractDoor}
                windows={AbstractWindow}
                tires={AbstractTire}
                rims={AbstractRim}
                color={AbstractCarColor}
              />
            } />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
